import React from 'react';
import './MovieRow.css';

const MovieRow = ({ movies }) => {

    return (
        <div className="d-inline-flex">{
            movies.map(movie => {
                return (
                    <div className="movie-item">
                        {movie.title}
                    </div>
                )
            })
        }</div>

    )
}

export default MovieRow;
